class Solution(object):
	def numDecodings(self, s):
		dp = [i for i in range(len(s))]
		for i in range(len(s)):
			if i == 0:
				if '1' <= s[i] <= '9':
					dp[0] = 1
				elif s[i] == '*':
					dp[0] = 9
				else:
					dp[0] = 0
			else:
				x = dp[i-1]
				if s[i] == '*':
					m = 9
				elif '1'<=s[i]<='9':
					m = 1
				else:
					m = 0
				y = 1 if i<2 else dp[i-2]
				n = self.getNumP(s[i-1],s[i])
				print(x,m,y,n,i)
				dp[i] = (x*m)%(10**9+7)+(y*n)%(10**9+7)

		return dp

	def getNumP(self, m, n):
		p = 0
		if m == '*':
			if n == '*':
				p = 15
			elif '0' <= n <= '6':
				p = 2
			else:
				p = 1
		elif m == '1':
			if n == '*':
				p = 9
			elif '0' <= n <= '9':
				p = 1
		elif m == '2':
			if n == '*':
				p = 6
			elif '0' <= n <= '6':
				p = 1
			else:
				p = 0
		return p
print(Solution().numDecodings("***"))
